        min_mst_cost = float('inf')

        for i, (u, v, w) in enumerate(edges):
            for j in range(w + 1):
                modify_edge(i, w - j)
                mst_cost = find_mst_cost(n, edges)
                if mst_cost < min_mst_cost:
                    min_mst_cost = mst_cost
                modify_edge(i, w)

            if min_mst_cost < min_cost:
                min_cost = min_mst_cost

