                    min_dist = dist[i]
                    min_node = i
            if min_node == -1:
                break
            visited[min_node] = True
            for neighbor, weight in graph[min_node]:
                new_dist = dist[min_node] + weight
                if new_dist < dist[neighbor]:
                    dist[neighbor] = new_dist
        return dist[end]

