def solution(stdin: str) -> str:
    N, A = map(int, stdin.split())
    x = list(map(int, stdin.split()[1:]))

    def count_ways(N, A, x):
        if N == 1:
            return 1 if x[0] == A else 0

        total = sum(x)
        average = total // N

        if total % N != 0:
            return 0

        if average == A:
            return 1

        if average < A:
            return 0

        ways = 0
        for i in range(N):
            if x[i] < A:
                continue
            ways += count_ways(N - 1, A, x[:i] + x[i+1:])

        return ways

    return str(count_ways(N, A, x))

