            for j in range(3):
                if grid[i][j] == grid[i][j + 1]:
                    grid[i][j] *= 2
                    grid[i][j + 1] = 0
        return grid

    def move(grid: list, direction: int) -> list:
        if direction == 0:
            for i in range(4):
                for j in range(3):
                    if grid[i][j] != 0 and grid[i][j + 1] == 0:
                        grid[i][j + 1] = grid[i][j]
