        return ''.join(row_list)

    def jump(row1: str, row2: str) -> str:
        row1_list = list(row1)
        row2_list = list(row2)
        for i in range(N1 - 1):
            if row1_list[i] != row1_list[i + 1]:
                if row1_list[i] == row2_list[i]:
