        return ''.join(row1_list)

    row1_list = list(row1)
    row2_list = list(row2)

    for _ in range(T):
        row1_list = swap(row1_list, 0, 1)
        row2_list = swap(row2_list, 0, 1)
        row1_list = jump(row1_list, row2_list)
        row2_list = jump(row2_list, row1_list)

    return ''.join(row1_list) + ''.join(row2_list)

